import React from 'react';
import { LinkedinIcon } from './svgs/LinkedinIcon.jsx';
import { GithubIcon } from './svgs/GithubIcon.jsx';

export const Footer = ({screenWidth}) => {

    return (
        <footer id="contact">
            <div class="content">
                <h2>Get in touch with Alistair Sinclair-Smith</h2>
                <p>Drop me an email and let's discuss how I can help you!</p>
                <p>Email: <a href="mailto:alistairjss90@gmail.com" target="_blank" rel="noopener">alistairjss90@gmail.com</a></p>
                <p>Or check me out on social media.</p>
                <div id="icons">
                    <a href="https://uk.linkedin.com/in/alistair-sinclair-smith-b247884a" aria-label="Icon link for Alistair Sinclair-Smith's LinkedIn profile." target="_blank" rel="noopener" class="nav-link">
                        <LinkedinIcon />
                    </a>
                    <a href="https://github.com/HalfElfAlistair" aria-label="Icon link for Alistair Sinclair-Smith's GitHub profile." target="_blank" rel="noopener" class="nav-link">
                        <GithubIcon />
                    </a>
                </div>
            </div>
        </footer>	
    )
}
